(function() {
angular.module('taxiServiceApp', ['ngProgress', 'ui.router', 'ngAnimate', 'ngSanitize', 'ui.bootstrap']);

    angular.module('taxiServiceApp').config(config);

    config.$inject = ['$stateProvider', '$locationProvider'];

    function config($stateProvider, $locationProvider) {
        $locationProvider.hashPrefix('!');

        var states = [
            { 
                name: 'users', 
                url: '/users', 
                component: 'usersComponent' 
            },
        ];

        states.forEach(function(state) {
            $stateProvider.state(state);
        });
    }
})();

(function() {
    angular
        .module('taxiServiceApp')
        .factory('baseHttpService', baseHttpService);
    
    baseHttpService.$inject = ['$http'];
    
    function baseHttpService($http) {
        return {
            makeRequest: function(methodArg, urlArg, dataArg, headersArg) {
                var requestConfigObject = {
                    method: methodArg,
                    url: urlArg,
                    data: dataArg,
                    headers: headersArg
                };

                return $http(requestConfigObject);
            }
        };
    } 
})();
(function() {
    angular
        .module('taxiServiceApp')
        .factory('constantsService', constantsService);

    function constantsService() {
        return {
            SERVER_URL: 'http://localhost:3000/api'
        };
    }
})();
(function() {
    angular
        .module('taxiServiceApp')
        .factory('progressBarService', progressBarService);

        progressBarService.$inject = ['ngProgressFactory'];

        function progressBarService(ngProgressFactory) {
            var progressBar = ngProgressFactory.createInstance();

            progressBar.setHeight('7px');
            progressBar.setColor('#ecf0f1');

            return {
                start: function() {
                    progressBar.start();
                },
                complete: function() {
                    progressBar.complete();
                }
            };
        }
})();
(function() {
    angular
        .module('taxiServiceApp')
        .component('addUserModalComponent', {
            bindings: {
                close: '&',
                dismiss: '&'
            },
            templateUrl: '../templates/components/users/add-user-modal.template.html',
            controller: AddUserModalController
        });
    
    AddUserModalController.$inject = ['usersHttpService'];

    function AddUserModalController(usersHttpService) {
        var self = this;

        self.clearErrors = function() {
            delete self.errors;
        };

        self.add = function($event) {
            $event.preventDefault();

            self.clearErrors();

            usersHttpService.add(self.newUser)
                .then(function() {
                    self.close();
                }, function(response) {
                    self.errors = response.data;
                });       
        };

        self.cancel = function() {
            self.dismiss();
        };
    } 
})();
(function() {
    angular
        .module('taxiServiceApp')
        .component('updateUserModalComponent', {
             bindings: {
                close: '&',
                dismiss: '&',
                resolve: '<'
            },
            templateUrl: '../templates/components/users/update-user-modal.template.html',
            controller: UpdateUserModalController
        });

    UpdateUserModalController.$inject = ['usersHttpService'];

    function UpdateUserModalController(usersHttpService) {
        var self = this;
        
        self.$onInit = function() {
            self.updatedUser = {
                id: self.resolve.updatedUser.id,
                newUsername: self.resolve.updatedUser.username,
                oldUsername: self.resolve.updatedUser.username
            };
        };

        self.update = function() {
            usersHttpService.update(self.updatedUser)
                .then(function() {
                    self.close();
                }, function(response) {
                    self.errors = response.data;
                });
        };

        self.clearErrors = function() {
            delete self.errors;
        };

        self.cancel = function() {
            self.dismiss();
        };
    }
})();
(function() {
    angular
        .module('taxiServiceApp')
        .factory('usersHttpService', usersHttpService);
    
    usersHttpService.$inject = ['baseHttpService', 'constantsService'];

    function usersHttpService(baseHttpService, constantsService) {
        var usersUrl = constantsService.SERVER_URL + '/users/';

        return {
            getAll: function() {
                return baseHttpService.makeRequest('GET', usersUrl);
            },
            deleteById: function(id) {
                return baseHttpService.makeRequest('DELETE', usersUrl + id);
            },
            update: function(updatedUser) {
                return baseHttpService.makeRequest('PUT', usersUrl, updatedUser);    
            },
            add: function(newUser) {
                return baseHttpService.makeRequest('POST', usersUrl, newUser);
            }
        };
    }
})();
(function() {
    angular
        .module('taxiServiceApp')
        .component('usersComponent', {
           templateUrl: '../templates/components/users/users.template.html',
           controller: UsersController,
        });
    
    UsersController.$inject = ['usersHttpService', 'progressBarService', '$uibModal'];

    function UsersController(usersHttpService, progressBarService, $uibModal) {
        var self = this;

        self.add = function() {
            var modalInstance = $uibModal.open({
                animation: true,
                component: 'addUserModalComponent'
            });

            modalInstance.result
                .then(function() {
                    self.getAll();
                });
        };

        self.getAll = function() {  
            progressBarService.start();

            usersHttpService.getAll()
                .then(function(response) {
                    self.users = response.data;
                    progressBarService.complete();
                });
        };

        self.deleteById = function(id) {
            usersHttpService.deleteById(id)
                .then(function() {
                    var index = self.users.map(function(user) { return user.id; }).indexOf(id);

                    self.users.splice(index, 1);
                });
        };

        self.update = function(user) {
            var modalInstance = $uibModal.open({
                animation: true,
                component: 'updateUserModalComponent', 
                resolve: {
                    updatedUser: function() {
                        return user;
                    }
                }
            });

            modalInstance.result
                .then(function() {
                    self.getAll();
                });
        };

        self.getAll();
    }
})();
